import React from 'react';

const TechnicalSkills = () => {
    return (
        <section id="technical-skills">
            <h2>Technical Skills</h2>
            <ul>
                <li>Programming Languages: Java, JavaScript, TypeScript, Python</li>
                <li>Frameworks: Spring Boot, Spring Framework</li>
                <li>Databases: PostgreSQL, SQL Server, Oracle</li>
                <li>Cloud Platforms: Google Cloud Platform</li>
                <li>Tools & Technologies: Docker, Kubernetes, DevOps, RESTful APIs, Microservices, PowerShell scripting</li>
                <li>Development Methodologies: Agile, Scrum</li>
                <li>Other: XML Schema, HTML, CSS, jQuery</li>
            </ul>
        </section>
    );
};

export default TechnicalSkills;
